import React from "react";
import NavBar from "./NavBar";
import Hero from "./Hero";
import Footer from "./Footer";
import Contact from "./Contact";
import './App.css'
import first from './images/pretty-drops.jpg' 
import second from './images/pretty-bubble.jpg' 
import third from './images/pretty-waves.jpg' 
import fourth from './images/superb-vase.jpg'
export default function App() {
    return (
        <div>
            <Contact 
                img={first}
                name="Mr. Whiskerson"
                phone="(212) 555-1234"
                mail="mrwhiskerson@gmail.com"
            />
            <Contact 
                img={second}
                name="Fluffykins"
                phone="(212) 555-2345"
                mail="fluff@gmail.com"
            />
            <Contact
                img={third}
                name="Felix"
                phone="(212) 555-457"
                mail="thecat@gmail.com"
            />
            <Contact
                img={fourth}
                name="Pumpkin"
                phone="(212) 555-678"
                email="pumpkin@gmail.com"
            />
        </div>
       
    );
}
